var w=800, h=800;
var xa=64, xb=w-64, ya=32, yb=112, yc=160, yd=h-24, chh=40, npks=2;
const colors=['#808080', '#3366CC', '#FF9900', '#F0F8F0', '#80E080'];
function stroke(ctx, c, l) { ctx.strokeStyle=c; ctx.lineWidth=l; ctx.stroke(); }
function strokerect(ctx, c, l, x, y, w, h) { ctx.strokeStyle=c; ctx.lineWidth=l; ctx.strokeRect(x, y, w, h); }
function fill(ctx, c) { ctx.fillStyle=c; ctx.fill(); }
function fillrect(ctx, c, x, y, w, h) { ctx.fillStyle=c; ctx.fillRect(x, y, w, h); }
function text(ctx, c, a, b, t, x, y) { ctx.fillStyle=c; ctx.textAlign=a; ctx.textBaseline=b; ctx.fillText(t, x, y); }
function clip(ctx, x, y, w, h) { ctx.save(); ctx.beginPath(); ctx.rect(x, y, w, h); ctx.clip(); }
function to_x(x) { return xa+(xb-xa)*x; }
function to_y(y, i) { return i >= 0 && i < npks ? ya+chh*((i|1)-y) : yc+(yd-yc)*y; }
function from_x(x) { return (x-xa)/(xb-xa); }
function draw_chart(canv, data, tipx, tipy) {
  npks=Math.max(data.series.length-2, 1);
  chh = npks <= 2 ? 60 : npks <= 4 ? 40 : 20;
  let reg = 'regions' in data && document.getElementById('regions').checked;
  let mrk = 'markers' in data && document.getElementById('markers').checked;
  w=canv.width=Math.max(window.innerWidth-32, 800);
  h=canv.height=800+chh*npks+40*(reg+mrk);

  let ctx=canv.getContext('2d');
  ctx.clearRect(0, 0, w, h);
  ctx.font='1em monospace';
  let x=xa;
  text(ctx, '#000000', 'left', 'top', 'File: '+data.name, x, 0);
  x += ctx.measureText('File: '+data.name).width+48;
  fillrect(ctx, colors[0], x, 6, 40, 3);
  for (let i=npks; i < data.series.length; ++i) {
    fillrect(ctx, colors[i-npks+1], x, 6, 40, 3);
    text(ctx, '#000000', 'left', 'top', data.series[i], x+48, 0);
    x += ctx.measureText(data.series[i]).width+96;
  }
  fillrect(ctx, colors[4], x, 6, 40, 3);
  text(ctx, '#000000', 'left', 'top', data.integrated[0], x+48, 0);
  x += ctx.measureText(data.integrated[0]).width+96;
  if ('dynrange' in data) {
    fillrect(ctx, colors[3], x, 0, 40, 16);
    text(ctx, '#000000', 'left', 'top', data.dynrange[0], x+48, 0);

    fillrect(ctx, colors[3], xa, yhi, xb-xa, ylo-yhi);
  }
  let y=to_y(data.integrated[1], -1);
  fillrect(ctx, colors[4], xa, y-1, xb-xa, 2);

    let ylo=to_y(data.histogram[i][0], -1), yhi=to_y(data.histogram[i][1], -1);
    if (yhi >= yd) yhi=h;
    ctx.globalAlpha=Math.sqrt(data.histogram[i][2]);
    fillrect(ctx, colors[1], xb+16, ylo, 46, yhi-ylo);

    let y=Math.floor(to_y(data.ymaj[i][0], -1))+0.5;
    ctx.moveTo(xa-8, y);
    ctx.lineTo(xb+8, y);
    text(ctx, '#000000', 'right', 'middle', data.ymaj[i][1], xa-24, y);
  }

    ctx.moveTo(x, yc);

    ctx.beginPath();
    ctx.lineTo(xa+1, to_y(data.vals[0][i+1][0], i));
    for (let j=0; j < data.vals.length; ++j) {
      ctx.lineTo(to_x(data.vals[j][0][0]), to_y(data.vals[j][i+1][0], i));
    }
    for (let j=data.vals.length-1; j >= 0; --j) {
      ctx.lineTo(to_x(data.vals[j][0][0]), to_y(data.vals[j][i+2][0], i));
    }
    ctx.lineTo(xa+1, to_y(data.vals[0][i+2][0], i));
    stroke(ctx, colors[0]); fill(ctx, colors[0]);
  }
  for (let i=npks; i < data.series.length; ++i) {
    ctx.beginPath();
    for (let j=0; j < data.vals.length; ++j) {
      ctx.lineTo(to_x(data.vals[j][0][0]), to_y(data.vals[j][i+1][0], i));
    }
    stroke(ctx, colors[i-npks+1], 2);
  }
  let sx=-1, ex=-1;
  for (let i=0; i <= data.vals.length; ++i) {
    if (i < data.vals.length && data.vals[i][1][1].startsWith('+')) {

      sx=ex=-1;
    }

      str[0]=data.series[npks];
      str[1]=data.histogram[j][3]+' to '+data.histogram[j][4];
      str[2]=data.histogram[j][5]+' of '+data.xrange[1];
    }

      tipw=128; tiph=18*(data.series.length-npks+2)+12;
      let tx=from_x(tipx);
      let j=0;
      for (; j < data.vals.length-1; ++j) {
        if (data.vals[j][0][0] > tx) break;
      }
      if (j < data.vals.length-1 && data.vals[j+1][0][0]-tx < tx-data.vals[j][0][0]) ++j;
      str[0]=data.vals[j][0][1];
      let pk=0.0, pki=-1;
      for (let i=0; i < data.series.length; ++i) {
        if (i < npks) {
          if (!i || Math.abs(data.vals[j][i+1][0]) > pk) {
            pki=i;
            pk=Math.abs(data.vals[j][i+1][0]);
            col[1]=colors[0];
            str[1]='Peak '+data.vals[j][i+1][1];
          }
        }
        else {
          col[i-npks+2]=colors[i-npks+1];
          str[i-npks+2]=data.series[i]+' '+data.vals[j][i+1][1];
        }
      }
      for (let i=0; i < data.series.length; ++i) {
        if (i == pki || i >= npks) {
          ctx.beginPath();
          ctx.arc(to_x(data.vals[j][0][0]), to_y(data.vals[j][i+1][0], i), 3, 0, 2*Math.PI, false);
          fill(ctx, i < npks ? '#000000' : colors[i-npks+1]);
        }
      }
    }
    if (tipx < xa+tipw/2+1) tipx=xa+tipw/2+1;
    else if (tipx > xb-tipw/2-1) tipx=xb-tipw/2-1;
    tipy += 96;
    if (tipy > h-tiph/2-1) tipy=h-tiph/2-1;

    tipy += 16-tiph/2;
    ctx.font='0.8em monospace';
    for (let i=0; str[i]; ++i) {
      text(ctx, col[i], 'center', 'middle', str[i], tipx, tipy);
